import React, { useState } from 'react';

const BookingForm = ({ onSubmit }) => {
  const [formData, setFormData] = useState({ name: '', vehicle: '', duration: '' });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
    alert('Pemesanan berhasil!');
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Formulir Pemesanan</h2>
      <input type="text" name="name" placeholder="Nama" onChange={handleChange} required />
      <input type="text" name="vehicle" placeholder="Nomor Kendaraan" onChange={handleChange} required />
      <input type="number" name="duration" placeholder="Durasi (jam)" onChange={handleChange} required />
      <button type="submit">Pesan Tempat</button>
    </form>
  );
};

export default BookingForm;
